  ('GO:0031047',' gene silencing by RNA','biological_process','A process in which an RNA molecule reduces expression of target genes. This can occur pre-transcriptionally by assembly of heterochromatin and prevention of transcription or co- or post-transcriptionally by targeting RNAs for degradation or by interfering with splicing or translation. This process starts once the inhibitory RNA molecule has been transcribed, and includes processing of the RNA such as cleavage, modifications, transport from the nucleus to the cytoplasm, loading onto the RISC complex, and the effect on transcription or translation. [PMID:15020054]'),
  ('GO:0031386',' protein tag','molecular_function','A molecular function exhibited by a protein that is covalently attached (AKA tagged or conjugated) to another protein where it acts as a marker, recognized by the cellular apparatus to target the tagged protein for some cellular process such as modification, sequestration, transport or degradation. [GOC:dos'),
  ('GO:0031410',' cytoplasmic vesicle','cellular_component','A vesicle found in the cytoplasm of a cell. [GOC:ai'),
  ('GO:0032200',' telomere organization','biological_process','A process that is carried out at the cellular level which results in the assembly, arrangement of constituent parts, or disassembly of telomeres, terminal regions of a linear chromosome that include the telomeric DNA repeats and associated proteins. [GOC:dph'),
  ('GO:0034330',' cell junction organization','biological_process','A process that is carried out at the cellular level which results in the assembly, arrangement of constituent parts, or disassembly of a cell junction. A cell junction is a specialized region of connection between two cells or between a cell and the extracellular matrix. [GOC:dph'),
  ('GO:0036211',' protein modification process','biological_process','The covalent alteration of one or more amino acids occurring in proteins, peptides and nascent polypeptides (co-translational, post-translational modifications). Includes the modification of charged tRNAs that are destined to occur in a protein (pre-translation modification). [GOC:bf'),
  ('GO:0038024',' cargo receptor activity','molecular_function','Binding specifically to a substance (cargo) to deliver it to a transport vesicle. Cargo receptors span a membrane (either the plasma membrane or a vesicle membrane), binding simultaneously to cargo molecules and coat adaptors, to efficiently recruit soluble proteins to nascent vesicles. [PMID:15239958'),
  ('GO:0042060',' wound healing','biological_process','The series of events that restore integrity to a damaged tissue, following an injury. [GOC:bf'),
