  ('GO:0042393',' histone binding','molecular_function','Binding to a histone, any of a group of water-soluble proteins found in association with the DNA of eukaryotic or archaeal chromosomes. They are involved in the condensation and coiling of chromosomes during cell division and have also been implicated in gene regulation and DNA replication. They may be chemically modified (methylated, acetlyated and others) to regulate gene transcription. [GOC:jl'),
  ('GO:0043226',' organelle','cellular_component','Organized structure of distinctive morphology and function. Includes the nucleus, mitochondria, plastids, vacuoles, vesicles, ribosomes and the cytoskeleton, and prokaryotic structures such as anammoxosomes and pirellulosomes. Excludes the plasma membrane. [GOC:go_curators]'),
  ('GO:0044183',' protein folding chaperone','molecular_function','Binding to a protein or a protein-containing complex to assist the protein folding process. [GOC:mtg_cambridge_2009]'),
  ('GO:0044782',' cilium organization','biological_process','A process that is carried out at the cellular level which results in the assembly, arrangement of constituent parts, or disassembly of a cilium, a specialized eukaryotic organelle that consists of a filiform extrusion of the cell surface. Each cilium is bounded by an extrusion of the cytoplasmic membrane, and contains a regular longitudinal array of microtubules, anchored basally in a centriole. [GOC:cilia'),
  ('GO:0045182',' translation regulator activity','molecular_function','Any molecular function involved in the initiation, activation, perpetuation, repression or termination of polypeptide synthesis at the ribosome. [GOC:ai]'),
  ('GO:0045735',' nutrient reservoir activity','molecular_function','Functions in the storage of nutritious substrates. [GOC:ai]'),
  ('GO:0048018',' receptor ligand activity','molecular_function','The activity of a gene product that interacts with a receptor to effect a change in the activity of the receptor. Ligands may be produced by the same, or different, cell that expresses the receptor. Ligands may diffuse extracellularly from their point of origin to the receiving cell, or remain attached to an adjacent cell surface (e.g. Notch ligands). [GOC:kv'),
  ('GO:0048856',' anatomical structure development','biological_process','The biological process whose specific outcome is the progression of an anatomical structure from an initial condition to its mature state. This process begins with the formation of the structure and ends with the mature structure, whatever form that may be including its natural destruction. An anatomical structure is any biological entity that occupies space and is distinguished from its surroundings. Anatomical structures can be macroscopic such as a carpel, or microscopic such as an acrosome. [GO_REF:0000021]'),
  ('GO:0048870',' cell motility','biological_process','Any process involved in the controlled self-propelled movement of a cell that results in translocation of the cell from one place to another. [GOC:dgh'),
  ('GO:0050877',' nervous system process','biological_process','A organ system process carried out by any of the organs or tissues of neurological system. [GOC:ai'),
  ('GO:0050886',' endocrine process','biological_process','The process that involves the secretion of or response to endocrine hormones. An endocrine hormone is a hormone released into the circulatory system. [ISBN:0721662544]'),
  ('GO:0051604',' protein maturation','biological_process','Any process leading to the attainment of the full functional capacity of a protein. [GOC:ai]'),
  ('GO:0055065',' metal ion homeostasis','biological_process','Any process involved in the maintenance of an internal steady state of metal ions within an organism or cell. [GOC:ai'),
  ('GO:0055085',' transmembrane transport','biological_process','The process in which a solute is transported across a lipid bilayer, from one side of a membrane to the other. [GOC:dph'),
  ('GO:0055086',' nucleobase-containing small molecule metabolic process','biological_process','The cellular chemical reactions and pathways involving a nucleobase-containing small molecule: a nucleobase, a nucleoside, or a nucleotide. [GOC:vw]'),
  ('GO:0060089',' molecular transducer activity','molecular_function','A compound molecular function in which an effector function is controlled by one or more regulatory components. [GOC:dos'),
  ('GO:0060090',' molecular adaptor activity','molecular_function','The binding activity of a molecule that brings together two or more molecules through a selective, non-covalent, often stoichiometric interaction, permitting those molecules to function in a coordinated way. [GOC:mtg_MIT_16mar07'),
  ('GO:0061007',' hepaticobiliary system process','biological_process','An system process carried out by any of the organs or tissues of the hepaticobiliary system. The hepaticobiliary system is responsible for metabolic and catabolic processing of small molecules absorbed from the blood or gut, hormones and serum proteins, detoxification, storage of glycogen, triglycerides, metals and lipid soluble vitamins and excretion of bile. Included are the synthesis of albumin, blood coagulation factors, complement, and specific binding proteins. [GOC:dph]'),
  ('GO:0061024',' membrane organization','biological_process','A process which results in the assembly, arrangement of constituent parts, or disassembly of a membrane. A membrane is a double layer of lipid molecules that encloses all cells, and, in eukaryotes, many organelles; may be a single or double lipid bilayer; also includes associated proteins. [GOC:dph'),
  ('GO:0065003',' protein-containing complex assembly','biological_process','The aggregation, arrangement and bonding together of a set of macromolecules to form a protein-containing complex. [GOC:jl]'),
  ('GO:0071554',' cell wall organization or biogenesis','biological_process','A process that results in the biosynthesis of constituent macromolecules, assembly, arrangement of constituent parts, or disassembly of a cell wall. [GOC:mah]'),
  ('GO:0071941',' nitrogen cycle metabolic process','biological_process','A nitrogen compound metabolic process that contributes to the nitrogen cycle. The nitrogen cycle is a series of metabolic pathways by which nitrogen is converted between various forms and redox states; it encompasses pathways in which nitrogen is acted upon directly, such as nitrification, denitrification, nitrogen fixation, and mineralization. [GOC:mah'),
  ('GO:0072659',' protein localization to plasma membrane','biological_process','A process in which a protein is transported to, or maintained in, a specific location in the plasma membrane. [GOC:mah]'),
  ('GO:0090729',' toxin activity','molecular_function','Interacting selectively with one or more biological molecules in another (target) organism, initiating pathogenesis (leading to an abnormal, generally detrimental state) in the target organism. The activity should refer to an evolved function of the active gene product, i.e. one that was selected for. Examples include the activity of botulinum toxin, and snake venom. [GOC:pt]'),
  ('GO:0098542',' defense response to other organism','biological_process','Reactions triggered in response to the presence of another organism that act to protect the cell or organism from damage caused by that organism. [GOC:dos]'),
  ('GO:0098631',' cell adhesion mediator activity','molecular_function','The binding by a cell-adhesion protein on a cell surface to an adhesion molecule on another cell surface or an external substrate, to mediate adhesion of the cell to the external substrate or to another cell. [GOC:vw'),
  ('GO:0098754',' detoxification','biological_process','Any process that reduces or removes the toxicity of a toxic substance. These may include transport of the toxic substance away from sensitive areas and to compartments or complexes whose purpose is sequestration of the toxic substance. [GOC:dos]'),
  ('GO:0098772',' molecular function regulator activity','molecular_function','A molecular function regulator regulates the activity of its target via non-covalent binding that does not result in covalent modification to the target. Examples of molecular function regulators include regulatory subunits of multimeric enzymes and channels. Mechanisms of regulation include allosteric changes in the target and competitive inhibition. [GOC:dos'),
  ('GO:0120274',' virus coreceptor activity','molecular_function','Combining with a virus component, and in cooperation with a nearby primary receptor, initiating a change in cell activity. [GOC:ha'),
  ('GO:0140013',' meiotic nuclear division','biological_process','One of the two nuclear divisions that occur as part of the meiotic cell cycle. [PMID:9334324]'),
  ('GO:0140014',' mitotic nuclear division','biological_process','A mitotic cell cycle process comprising the steps by which the nucleus of a eukaryotic cell divides; the process involves condensation of chromosomal DNA into a highly compacted form. Canonically, mitosis produces two daughter nuclei whose chromosome complement is identical to that of the mother cell. [ISBN:0198547684]'),
  ('GO:0140053',' mitochondrial gene expression','biological_process','The process in which a mitochondrial gene"s sequence is converted into a mature gene product or products (proteins or RNA). This includes the production of an RNA transcript as well as any processing to produce a mature RNA product or an mRNA or circRNA (for protein-coding genes) and the translation of that mRNA or circRNA into protein. Protein maturation is included when required to form an active form of a product from an inactive precursor form. [PMID:27058308]'),
  ('GO:0140096',' catalytic activity','molecular_function','Catalytic activity that acts to modify a protein. [GOC:molecular_function_refactoring'),
  ('GO:0140097',' catalytic activity','molecular_function','Catalytic activity that acts to modify DNA. [GOC:molecular_function_refactoring'),
  ('GO:0140098',' catalytic activity','molecular_function','Catalytic activity that acts to modify RNA, driven by ATP hydrolysis. [GOC:molecular_function_refactoring'),
  ('GO:0140104',' molecular carrier activity','molecular_function','Directly binding to a specific ion or molecule and delivering it either to an acceptor molecule or to a specific location. [GOC:molecular_function_refactoring'),
  ('GO:0140110',' transcription regulator activity','molecular_function','A molecular function that controls the rate, timing and/or magnitude of gene transcription. The function of transcriptional regulators is to modulate gene expression at the transcription step so that they are expressed in the right cell at the right time and in the right amount throughout the life of the cell and the organism. Genes are transcriptional units, and include bacterial operons. [GOC:pg'),
  ('GO:0140223',' general transcription initiation factor activity','molecular_function','A molecular function required for core promoter activity that mediates the assembly of the RNA polymerase holoenzyme at promoter DNA to form the pre-initiation complex (PIC). General transcription factors (GTFs) bind to and open promoter DNA, initiate RNA synthesis and stimulate the escape of the polymerase from the promoter. Not all subunits of the general transcription factor are necessarily present at all promoters to initiate transcription. GTFs act at each promoter, although the exact subunit composition at individual promoters may vary. [GOC:txnOH-2018]'),
  ('GO:0140299',' small molecule sensor activity','molecular_function','Binding to a small molecule and eliciting a change in the protein"s activity in response to the intracellular level of that small molecule. [PMID:26328879]'),
  ('GO:0140313',' molecular sequestering activity','molecular_function','Binding to a specific molecule to prevent it from interacting with other partners or to inhibit its localization to the area of the cell or complex where it is active. [PMID:13130076]'),
  ('GO:0140657',' ATP-dependent activity','molecular_function','A molecular function characterized by the coupling of ATP hydrolysis to other steps of a reaction mechanism to make the reaction energetically favorable, for example to catalyze a reaction or drive transport against a concentration gradient. [PMID:24878343'),
  ('GO:0140691',' RNA folding chaperone','molecular_function','Binding to an RNA or an RNA-containing complex to assist the folding process. [PMID:31165735]'),
  ('GO:1901135',' carbohydrate derivative metabolic process','biological_process','The chemical reactions and pathways involving carbohydrate derivative. [GOC:TermGenie]');

